INSERT INTO `db_news` (`id`, `title`, `news`, `date_add`) VALUES
(7, 'Новогодний конкурс РЕФЕРАЛОВ!', 'Стартовали конкурс рефералов, \n<br>призовой <b>ФОНД = 12 000 руб.</b><br>\n\nНе много денег на новогодние дни) <br>\nСпасибо что участвуете в проекте!', 1575445590),
(8, 'Убрал ограничение доступа!', 'Сегодня убрал ограничения доступа к раздачам! \n<br>\nТеперь все страницы раздачи доступны! ', 1575565433),
(9, 'Стартовала АКЦИЯ', 'С этой секунды и до 10.12.2019 00:00 МСК, будет проводится АКЦИЯ на пополнения баланса покупок!<br><br>\r\n+10% к любой сумме пополнения!\r\n<br><br>\r\nВ связи с запуском КОНКУРСА, решил мотивировать участников к инвестированию, вот таким вот способом! Надеюсь, это поможет увеличить активность на проекте! \r\n<br>\r\nВсем спасибо за участие, Всем удачи!', 1575653463),
(6, 'Обновление РАЗДАЧИ', 'Друзья, для мотивации приглашать друзей, я сделал несколько уровней раздачи в каждом разделе! \r\n<br><br>\r\nТеперь раздачу можно получать на много больше чем раньше! Для этого приводите как можно больше рефералов! И Вы сможете зарабатывать не только от рефералов, но и от раздачи, на много больше! ', 1575417481);
